import React from 'react';
import './App.css';

const numbers = [1, 4, 6, 8, 45, 89];

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      numbers: numbers
    }
  }


  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
